import React, { useState } from 'react';
import { HashRouter } from 'react-router-dom';
import Admin from './admin';
import Login from './login';




function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <>
    <HashRouter>
      <Switch>
        {isLoggedIn 
        ? <Admin/>
        : <Login/>}
        <div className='info'>

        </div>
      </Switch>
    </HashRouter>
    </>
  );
};

export default App;
